// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{ padding: '10px', backgroundColor: '#007bff', color: 'white' }}>
      <ul style={{ listStyleType: 'none', margin: 0, padding: 0 }}>
        <li style={{ display: 'inline', marginRight: '10px' }}><Link to="/" style={{ color: 'white', textDecoration: 'none' }}>Home</Link></li>
        <li style={{ display: 'inline', marginRight: '10px' }}><Link to="/menu" style={{ color: 'white', textDecoration: 'none' }}>Menu</Link></li>
        <li style={{ display: 'inline' }}><Link to="/reservations" style={{ color: 'white', textDecoration: 'none' }}>Reservations</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
